import React from "react";
import "./styles.scss";
import logo from "../../images/ME-LOGO.png";
import Hamburger from "../Hamburger/Hamburger";
import { Button } from "@material-ui/core";
import { withStyles } from "@material-ui/core/styles";

const StyledButtonLink = withStyles({
  root: {
    borderRadius: 3,
    border: "2px solid #fdd835",
    color: "#fff",
    height: 48,
    padding: "0 30px",
    // boxShadow: "0 3px 5px 2px rgba(255, 105, 135, .3)",
  },
})(Button);

const NavigationBar = () => {
  return (
    <header>
      <div className="nav">
        <div>
          <a href="#top">
            <img src={logo} alt="maisiembleton-logo" className="nav-logo" />
          </a>
        </div>
        <div className="nav-links">
          <a href="#about">ABOUT</a>
          <a href="#work">WORK</a>
          <StyledButtonLink variant="outlined" size="medium">
            SAY HI
          </StyledButtonLink>
          {/* <ButtonLink name="Say Hi!" link="mailto:maisiembleton@gmail.com" /> */}
        </div>
        <div className="nav-hamburger">
          <Hamburger />
        </div>
      </div>
    </header>
  );
};

export default NavigationBar;
